import React from 'react'

function UserNames() {
    const persons = [
        {
            id: 1,
            name: 'Yash',
            age:12,
            skill:"Chalu aadmin"
        },
        {
            id: 2,
            name: 'Yash2',
            age:13,
            skill:"Chalu aadmin"
        },{
            id: 3,
            name: 'Yash3',
            age:14,
            skill:"Chalu aadmin"
        },{
            id: 4,
            name: 'Yash5',
            age:15,
            skill:"Chalu aadmin"
        },{
            id: 5,
            name: 'Yash6',
            age:16,
            skill:"Chalu aadmin"
        },
    ]
    return (
        <div>
            {
                // users.map(names=>{
                // return <h2>{names}</h2>
                // })

                // users.map(names => <h3>{names}</h3>)
            persons.map(names, key => <h3>I am {names.name}, I am {names.age} years old, my skill is I am an {names.skill} and my id is {names.id}</h3>)
                }
        </div>
    )
}

export default UserNames
